    /**
     * 获取统一的 中间件服务 产品数据
     * @param array $site
     * @param array $data shopify 产品数据
     * @return array 统一的产品数据
     */
    public static function getProductData($site = [], $data = []) {
        $product = [
            'provider' => ListData::getValidData($site, 'provider', static::$provider),
            'provider_id' => \App\Util\ListData::getValidData($data, 'id', 0), //供应商商品id
            'provider_created_at' => Carbon::parse($data['created_at'])->toDateTimeString(), //供应商产品创建时间
            'provider_updated_at' => Carbon::parse($data['updated_at'])->toDateTimeString(), //供应商产品更新时间
            'user_id' => \App\Util\ListData::getValidData($site, 'seo_id', 0), //优化师id
            'user_name' => \App\Util\ListData::getValidData($site, 'seo_name', 0), //优化师姓名
            'department_id' => \App\Util\ListData::getValidData($site, 'department_id', 0), //部门编号
            'category_id' => 1508, //\App\Util\ListData::getValidData($data, 'product_type', 0), //分类id 暂时固定 1508
            'site_id' => \App\Util\ListData::getValidData($site, 'id', 0), //站点id
            'status' => 1, //数据状态1可用0不可用
            'thumb' => \App\Util\ListData::getValidData($data['image'], 'src', ''), //图片地址
            'title' => \App\Util\ListData::getValidData($data, 'title', ''), //产品标题
            'foreign_title' => \App\Util\ListData::getValidData($data, 'title', ''), //产品外文标题
//            'market_price' => \App\Util\ListData::getValidData($data['variants'][0], 'price', ''), //市场价格
//            'shop_price' => \App\Util\ListData::getValidData($data['variants'][0], 'price', ''), //销售价格
            'tag' => \App\Util\ListData::getValidData($data, 'tags', ''), //产品标题
            'is_sell' => 1,
//              'content' => \App\Util\ListData::getValidData($data, 'body_html', ''), //详情
//            'created_at' => Carbon::parse($data['created_at'])->toDateTimeString(), //创建时间
//            'updated_at' => Carbon::parse($data['updated_at'])->toDateTimeString(), //更新时间
        ];

        /*         * *************获取产品属性组************************* */
        $product_types = [];
        if (isset($data['options']) && $data['options']) {
            foreach ($data['options'] as $key => $product_type) {
                $product_types[$product_type['id']] = [
                    'provider' => $product['provider'], //供应商
                    'provider_id' => $product_type['id'], //供应商属性组id
                    'name' => $product_type['name'], //属性组名称
                    'sale_name' => $product_type['name'], //属性组销售外文名称
                ];

                /*                 * *************获取产品属性************************* */
                foreach ($product_type['values'] as $attr) {
                    $product_types[$product_type['id']]['attrs'][$attr] = [
                        'name' => $attr, //属性名称
                        'sale_name' => $attr, //属性销售外文名称
                    ];
                }
            }
        }
        $product['product_types'] = $product_types;

        /*         * *************获取产品sku************************* */
        $product_skus = [];
        $quantity = 0;
        foreach ($data['variants'] as $key => $sku) {

            $attrs = [];
            $name = [];
            if (isset($data['options'][0]) && $data['options'][0]) {
                $name[] = $data['options'][0]['name'] . ':' . $sku['option1'];
                $attrs[] = $sku['option1'];
            }

            if (isset($data['options'][1]) && $data['options'][1]) {
                $name[] = $data['options'][1]['name'] . ':' . $sku['option2'];
                $attrs[] = $sku['option2'];
            }

            if (isset($data['options'][2]) && $data['options'][2]) {
                $name[] = $data['options'][2]['name'] . ':' . $sku['option3'];
                $attrs[] = $sku['option3'];
            }

            $product_skus[] = [
                'provider' => $product['provider'], //供应商
                'provider_id' => $sku['id'], //供应商sku id
                'provider_created_at' => Carbon::parse($sku['created_at'])->toDateTimeString(), //供应商sku创建时间
                'provider_updated_at' => Carbon::parse($sku['updated_at'])->toDateTimeString(), //供应商sku更新时间
                'attrs' => $attrs,
                'name' => implode(',', $name), //SKU名称
                'price' => $sku['price'], //SKU价格
                'quantity' => $sku['inventory_quantity'], //SKU数量
//                'created_at' => Carbon::parse($sku['created_at'])->toDateTimeString(), //创建时间
//                'updated_at' => Carbon::parse($sku['updated_at'])->toDateTimeString(), //更新时间
            ];

            $quantity += $sku['inventory_quantity'];
        }

        $product['quantity'] = $quantity > 0 ? $quantity : 0;
        $product['product_skus'] = $product_skus;

        /*         * *************获取滚动图************************* */
        $product_galleries = [];
        foreach ($data['images'] as $image) {
            $product_galleries[] = [
                'url' => $image['src'],
//                'created_at' => Carbon::parse($image['created_at'])->toDateTimeString(), //创建时间
//                'updated_at' => Carbon::parse($image['updated_at'])->toDateTimeString(), //更新时间
                'provider_created_at' => Carbon::parse($image['created_at'])->toDateTimeString(), //供应商滚动图创建时间
                'provider_updated_at' => Carbon::parse($image['updated_at'])->toDateTimeString(), //供应商滚动图更新时间
            ];
        }
        $product['product_galleries'] = $product_galleries;

        return $product;
    }

    /**
     * 获取提供商订单产品数据
     * @param array $site 站点数据
     * @param array $orderData 提供商订单数据
     * @return string
     */
    public static function getOrderProducts($site = [], $orderData = [], $requestData = []) {

        /*         * *************获取订单产品数据************************* */
        $productIds = [];
        foreach ($orderData as $key => $item) {
            $productIds = array_merge($productIds, array_column($item['orderProducts'], 'provider_product_id'));
        }
        $productIds = array_unique(array_filter($productIds));

        if (empty($productIds)) {
            return $productIds;
        }

        $requestData = [
            'ids' => implode(',', $productIds),
            'fields' => 'id,title,vendor,product_type,created_at,handle,updated_at,published_at,template_suffix,tags,published_scope,published_scope,variants,options,images,image',
        ];
        $productData = static::getProducts($site, $requestData);

        return $productData;
    }

    /**
     * 获取统一的 中间件服务 订单数据
     * @param array $site 站点数据
     * @param array $orderData 提供商订单数据
     * @param type $productData
     * @return string
     */
    public static function getOrderData($site = [], $orderData = []) {

        if (empty($orderData)) {
            return [];
        }

        $data = [];
        $payStatus = [
            'authorized' => 0, //授权
            'pending' => 0, //待处理
            'partially_paid' => 1, //订单已部分支付
            'paid' => 1, //已付款
            'partially_refunded' => 1, //付款已部分退还
            'refunded' => 0, //已退款
            'voided' => 0, //付款已无效
        ];

        $currencyData = Currency::getAll();
        foreach ($orderData as $key => $item) {

            $cut_price = 0; //优惠价格
            if (isset($item['discount_codes']) && $item['discount_codes']) {
                foreach ($item['discount_codes'] as $discount) {
                    $cut_price += $discount['amount'];
                }
            }

            $comment = ''; //订单留言
            if (isset($item['note_attributes']) && $item['note_attributes']) {
                foreach ($item['note_attributes'] as $note) {
                    $comment .= $note['name'] . ':' . $note['value'];
                }
            }
            $comment .= (isset($item['note']) && !empty($item['note']) ? (' ' . $item['note']) : ''); //店主备注

            $payment_code = stripos($item['gateway'], '(COD)') !== false ? 'cod' : $item['gateway']; //支付代码
            $shipping_address = ListData::getValidData($item, 'shipping_address', ListData::getValidData($item, 'billing_address', [])); //收件人地址
            $currencyCode = ListData::getValidData($item, 'currency', 'USD'); //货币
            $currencyItem = ListData::getValidData($currencyData, $currencyCode, ["name" => $currencyCode, "currencyCode" => $currencyCode, "symbol" => $currencyCode]); //
            $orderItem = [
                'provider' => ListData::getValidData($site, 'provider', static::$provider),
                'provider_id' => ListData::getValidData($item, 'id', 0), //供应商订单id
                'provider_created_at' => $item['created_at'], //Carbon::parse($item['created_at'])->toDateTimeString(), //订单创建时间
                'provider_updated_at' => $item['updated_at'], //Carbon::parse($item['updated_at'])->toDateTimeString(), //订单更新时间
                'order_sn' => ListData::getValidData($item, 'id', 0), //订单编号
                'site_id' => ListData::getValidData($site, 'id', 0),
                'visitor_id' => ListData::getValidData(ListData::getValidData($item, 'customer', []), 'id', ''), //访客id
                'address_country' => ListData::getValidData($shipping_address, 'country', ''), //国家
                'address_city' => ListData::getValidData($shipping_address, 'province', ''), //省
                'address_area' => ListData::getValidData($shipping_address, 'city', ''), //市
                'address_address' => ListData::getValidData($shipping_address, 'address1', '') . ' ' . ListData::getValidData($shipping_address, 'address2', ''), //详细地址
                'address_code' => ListData::getValidData($shipping_address, 'zip', ''), //邮编
                'address_email' => ListData::getValidData($item, 'email', ''), //邮箱
                'address_phone' => ListData::getValidData($shipping_address, 'phone', ''), //地址电话
                'address_name' => ListData::getValidData($shipping_address, 'first_name', '') . ' ' . ListData::getValidData($shipping_address, 'last_name', ''), //收件人
                'payment_id' => 1, //付款方式id
                'payment_name' => ListData::getValidData($item, 'gateway', ''), //支付方式
                'payment_code' => $payment_code, //支付代码
                'total_price' => ListData::getValidData($item, 'total_price', 0), //所有订单项价格，折扣，运费，税金和小费的总和（必须为正数）。
                'ip' => ListData::getValidData(ListData::getValidData($item, 'client_details', []), 'browser_ip', '127.0.0.1'), //IP
                'user_agent' => ListData::getValidData(ListData::getValidData($item, 'client_details', []), 'user_agent', 'user_agent'), //浏览器信息
                'web_info' => serialize([Carbon::parse($item['created_at'])->timestamp, $shipping_address['phone'], $item['client_details']['user_agent']]), //序列化信息
                'comment' => $comment, //订单留言
                'cut_price' => $cut_price, //优惠价格
                'currency_code' => ListData::getValidData($currencyItem, 'currencyCode', 'USD'), //货币代码
                'currency_symbol' => ListData::getValidData($currencyItem, 'symbol', '$'), //货币符号
                'currency_name' => ListData::getValidData($currencyItem, 'name', '美元'), //货币符号
                'pay_status' => $payment_code == 'cod' ? 1 : (isset($payStatus[$item['financial_status']]) ? $payStatus[$item['financial_status']] : 0), //支付状态 1：已支付  0：未支付
                'freight' => 0, //运费
                'is_erp' => 0, //是否同步到erp 0：同步 1：不同步 默认：0
                'id_department' => $site['department_id'], //部门id
                'coupon_code' => '', //优惠码
                'sum_price' => $item['total_price'] + $cut_price, //原订单价格
                'region' => '', //地区
            ];

            /*             * *************订单商品************************ */
            $orderProducts = [];
            foreach ($item['line_items'] as $line_item) {
                $product_id = ListData::getValidData($line_item, 'product_id', ''); //shopify产品id
                $sku_id = ListData::getValidData($line_item, 'variant_id', '-1'); //shopify variant_id:20426565353590
                $quantity = ListData::getValidData($line_item, 'quantity', 1);
                $total_price = ListData::getValidData($line_item, 'price', 1);
                $shop_price = $total_price / $quantity;
                $title = ListData::getValidData($line_item, 'title', ''); //标题
                $orderProductItem = [
                    'provider' => $orderItem['provider'],
                    'provider_id' => $line_item['id'], //供应商 订单产品数据库记录id
                    'provider_product_id' => $product_id, //供应商商品id
                    'provider_sku_id' => $sku_id, //shopify variant_id:20426565353590
                    'provider_sku' => ListData::getValidData($line_item, 'sku', $sku_id), //shopify sku:17522242-black
                    'provider_sku_name' => ListData::getValidData($line_item, 'variant_title', ''), //shopify variant_title:gris / S
                    'site_id' => ListData::getValidData($site, 'id', 0),
                    'visitor_id' => ListData::getValidData(ListData::getValidData($item, 'customer', []), 'id', ''), //访客id
                    'market_price' => $shop_price, //市场价 shopify销售价
                    'shop_price' => $shop_price, //商品价格
                    'promotion_id' => 0, //促销活动ID
                    'promotion_price' => 0, //促销活动价格
                    'amount' => $quantity, //产品数量
                    'total_price' => $total_price, //产品数量
                    'cut_price' => 0, //优惠价
                    'title' => $title, //标题
                    'thumb' => '', //缩略图
                ];

                $orderProducts[] = $orderProductItem;
            }
            $orderItem['orderProducts'] = $orderProducts;

            $data[$orderItem['provider_id']] = $orderItem;
        }

        return $data;
    }

    /**
     * 获取完整的中间件服务订单数据
     * @param array $site 站点数据
     * @param array $orderData 提供商订单数据
     * @param type $productData
     * @return string
     */
    public static function getCompleteOrderData($site = [], $orderData = [], $productData = []) {

        if (empty($productData)) {
            return $orderData;
        }

        foreach ($orderData as $provider_id => &$item) {
            foreach ($item['orderProducts'] as &$line_item) {
                $product_id = ListData::getValidData($line_item, 'provider_product_id', ''); //shopify产品id

                if (empty($product_id)) {
                    unset($line_item['provider_product_id']);
                    continue;
                }

                $sku_id = ListData::getValidData($line_item, 'provider_sku_id', 0); //shopify variant_id:20426565353590
                $_productData = ListData::getValidData($productData, $product_id, []); //产品数据
                $productSkuData = ListData::getValidData($_productData, 'product_skus', []); //sku数据
                $productSkuData = ListData::getValidData($productSkuData, $sku_id, []);

                $line_item['product_id'] = ListData::getValidData($_productData, 'id', 0); //产品id
                $line_item['sku_id'] = ListData::getValidData($productSkuData, 'id', '-1'); //产品sku id
                $line_item['name'] = ListData::getValidData($productSkuData, 'name', $line_item['title']); //属性组合名称：0212 / M (产品接口：options.values)
                $line_item['attrs'] = ListData::getValidData($productSkuData, 'attrs', ''); //产品属性id

                $line_item['erp_product_id'] = ListData::getValidData($_productData, 'erp_id', 0); //erp产品id
                $line_item['erp_product_attrs'] = json_encode(ListData::getValidData($productSkuData, 'erp_attrs', [])); //erp属性idjson串
                $line_item['erp_product_attrs_titles'] = json_encode(ListData::getValidData($productSkuData, 'erp_attr_titles', [])); //erp属性值json串
            }
        }

        return $orderData;
    }

    /**
     * Execute the console command.
     *
     * @return mixed
     */
    public static function handle($site = [], $requestData = [], $requestMethod = 'GET') {

        //获取提供商订单数据
        $orderData = static::getOrders($site, $requestData, $requestMethod);
//        BLogger::getLogger('pull-order', 'queue')->info('=====拉取订单数据=====');
//        BLogger::getLogger('pull-order', 'queue')->info($orderData);

        /*         * *************获取中间件服务订单数据*************************** */
        $orderData = static::getOrderData($site, $orderData);
//        BLogger::getLogger('pull-order', 'queue')->info('=====中间件服务订单数据=====');
//        BLogger::getLogger('pull-order', 'queue')->info($orderData);

        /*         * *************获取订单产品数据************************* */
        $productData = static::getOrderProducts($site, $orderData, $requestData);
//        BLogger::getLogger('pull-order', 'queue')->info('=====拉取订单产品数据=====');
//        BLogger::getLogger('pull-order', 'queue')->info($productData);

        /*         * *************将产品导入到 中间件服务 数据库************************* */
        $productData = \App\Model\Product::add($productData);
//        BLogger::getLogger('pull-order', 'queue')->info('=====产品导入到 中间件服务 数据库=====');
//        BLogger::getLogger('pull-order', 'queue')->info($productData);

        /*         * *************获取完整的中间件服务订单数据*************************** */
        $orderData = static::getCompleteOrderData($site, $orderData, $productData);
//        BLogger::getLogger('pull-order', 'queue')->info('=====获取完整的中间件服务订单数据=====');
//        BLogger::getLogger('pull-order', 'queue')->info($orderData);

        $orderData = \App\Model\Order::add($orderData);
//        BLogger::getLogger('pull-order', 'queue')->info('=====中间件服务订单数据 导入到 中间件服务 数据库 =====');
//        BLogger::getLogger('pull-order', 'queue')->info($orderData);

        return $orderData;
    }

}
